---
--- Person Table
---

CREATE TABLE Person (
    id INT NOT NULL AUTO_INCREMENT,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    gender CHAR(1) NOT NULL,
    date_of_birth DATE NOT NULL,
    PRIMARY KEY (id)
);

---
--- User Table
---

CREATE TABLE User (
    id INT NOT NULL AUTO_INCREMENT,
    username VARCHAR(30) UNIQUE NOT NULL,
    pfp_url VARCHAR(255),
    bio VARCHAR(255) NOT NULL DEFAULT 'Welcome to my profile!',
    email VARCHAR(100) UNIQUE NOT NULL,
    pw VARCHAR(255) NOT NULL,
    PRIMARY KEY (id),
    FOREIGN KEY (id) REFERENCES Person(id) ON DELETE CASCADE
);

---
--- Admin Table
---

CREATE TABLE Admin (
    id INT NOT NULL AUTO_INCREMENT,
    username VARCHAR(30) UNIQUE NOT NULL,
    email VARCHAR(100) UNIQUE NOT NULL,
    federation VARCHAR(50),
    PRIMARY KEY (id),
    FOREIGN KEY (id) REFERENCES Person(id) ON DELETE CASCADE,
    FOREIGN KEY (username) REFERENCES User(username),
    FOREIGN KEY (email) REFERENCES User(email)
);

---
--- Powerlifter Table
---

CREATE TABLE Powerlifter (
    id INT AUTO_INCREMENT,
    PRIMARY KEY (id),
    FOREIGN KEY (id) REFERENCES Person(id) ON DELETE CASCADE
);

---
--- Favourites Table
---

CREATE TABLE Favourites (
    user_id INT,
    powerlifter_id INT,
    PRIMARY KEY (user_id, powerlifter_id),
    FOREIGN KEY (user_id) REFERENCES User(id) ON DELETE CASCADE,
    FOREIGN KEY (powerlifter_id) REFERENCES Powerlifter(id) ON DELETE CASCADE
);

---
--- Meet Table
---

CREATE TABLE Meet (
    meet_id INT NOT NULL AUTO_INCREMENT,
    name VARCHAR(150) NOT NULL,
    date DATE NOT NULL,
    state VARCHAR(50),
    country VARCHAR(50),
    federation VARCHAR(50),
    PRIMARY KEY (meet_id)
);

---
--- Powerlifter_Meets Table
---

CREATE TABLE Powerlifter_Meets (
    powerlifter_id INT NOT NULL,
    meet_id INT NOT NULL,
    PRIMARY KEY (powerlifter_id, meet_id),
    FOREIGN KEY (powerlifter_id) REFERENCES Powerlifter(id) ON DELETE CASCADE,
    FOREIGN KEY (meet_id) REFERENCES Meet(meet_id) ON DELETE CASCADE
);

---
--- Scores Table
---

CREATE TABLE Scores (
    powerlifter_id INT NOT NULL,
    meet_id INT NOT NULL,
    wilks DECIMAL(5,2),
    mccullough DECIMAL(5,2),
    glossbrenner DECIMAL(5,2),
    ipfp_points DECIMAL(10,5),
    UNIQUE KEY (powerlifter_id, meet_id, wilks, mccullough, glossbrenner, ipfp_points),
    FOREIGN KEY (powerlifter_id) REFERENCES Powerlifter(id) ON DELETE CASCADE,
    FOREIGN KEY (meet_id) REFERENCES Meet(meet_id) ON DELETE CASCADE
);

---
--- Person_Meet_Info Table
---

CREATE TABLE Person_Meet_Info (
    powerlifter_id INT NOT NULL,
    meet_id INT NOT NULL,
    division VARCHAR(50),
    weight_class VARCHAR(50),
    place VARCHAR(2),
    PRIMARY KEY (powerlifter_id, meet_id),
    FOREIGN KEY (powerlifter_id) REFERENCES Powerlifter(id) ON DELETE CASCADE,
    FOREIGN KEY (meet_id) REFERENCES Meet(meet_id) ON DELETE CASCADE
);

---
--- Lifts Table
---

CREATE TABLE Lifts (
    powerlifter_id INT NOT NULL,
    meet_id INT NOT NULL,
    bench1kg DECIMAL(8,2),
    bench2kg DECIMAL(8,2),
    bench3kg DECIMAL(8,2),
    best3benchkg DECIMAL(8,2),
    squat1kg DECIMAL(8,2),
    squat2kg DECIMAL(8,2),
    squat3kg DECIMAL(8,2),
    best3squatkg DECIMAL(8,2),
    deadlift1kg DECIMAL(8,2),
    deadlift2kg DECIMAL(8,2),
    deadlift3kg DECIMAL(8,2),
    best3deadliftkg DECIMAL(8,2),
    totalkg DECIMAL(8,2),
    PRIMARY KEY (powerlifter_id, meet_id),
    FOREIGN KEY (powerlifter_id) REFERENCES Powerlifter(id) ON DELETE CASCADE,
    FOREIGN KEY (meet_id) REFERENCES Meet(meet_id) ON DELETE CASCADE
);

